"    -- Consider arrays separately\r\n"
"    local bArray, maxCount = isArray(v)\r\n"
"    if bArray then\r\n"
"      for i = 1,maxCount do\r\n"
"        table.insert(rval, encode(v[i]))\r\n"
"      end\r\n"
"    else\t-- An object, not an array\r\n"
"      for i,j in base.pairs(v) do\r\n"
"        if isEncodable(i) and isEncodable(j) then\r\n"
"          table.insert(rval, '\"' .. encodeString(i) .. '\":' .. encode(j))\r\n"
"        end\r\n"
"      end\r\n"
"    end\r\n"
"    if bArray then\r\n"
"      return '[' .. table.concat(rval,',') ..']'\r\n"
"    else\r\n"
"      return '{' .. table.concat(rval,',') .. '}'\r\n"
"    end\r\n"
"  end\r\n"
"  \r\n"
"  -- Handle null values\r\n"
"  if vtype=='function' and v==null then\r\n"
"    return 'null'\r\n"
"  end\r\n"
"  \r\n"
"  base.assert(false,'encode attempt to encode unsupported type ' .. vtype .. ':' .. base.tostring(v))\r\n"
"end\r\n"
"\r\n"
"\r\n"
"--- Decodes a JSON string and returns the decoded value as a Lua data structure / value.\r\n"
"-- @param s The string to scan.\r\n"
"-- @param [startPos] Optional starting position where the JSON string is located. Defaults to 1.\r\n"
"-- @param Lua object, number The object that was scanned, as a Lua table / string / number / boolean or nil,\r\n"
"-- and the position of the first character after\r\n"
"-- the scanned JSON object.\r\n"
"function decode(s, startPos)\r\n"
"  startPos = startPos and startPos or 1\r\n"
"  startPos = decode_scanWhitespace(s,startPos)\r\n"
"  base.assert(startPos<=string.len(s), 'Unterminated JSON encoded object found at position in [' .. s .. ']')\r\n"
"  local curChar = string.sub(s,startPos,startPos)\r\n"
"  -- Object\r\n"
"  if curChar=='{' then\r\n"
"    return decode_scanObject(s,startPos)\r\n"
"  end\r\n"
"  -- Array\r\n"
"  if curChar=='[' then\r\n"
"    return decode_scanArray(s,startPos)\r\n"
"  end\r\n"
"  -- Number\r\n"
"  if string.find(\"+-0123456789.e\", curChar, 1, true) then\r\n"
"    return decode_scanNumber(s,startPos)\r\n"
"  end\r\n"
"  -- String\r\n"
"  if curChar==[[\"]] or curChar==[[']] then\r\n"
"    return decode_scanString(s,startPos)\r\n"
"  end\r\n"
"  if string.sub(s,startPos,startPos+1)=='/*' then\r\n"
"    return decode(s, decode_scanComment(s,startPos))\r\n"
"  end\r\n"
"  -- Otherwise, it must be a constant\r\n"
"  return decode_scanConstant(s,startPos)\r\n"
"end\r\n"
"\r\n"
"--- The null function allows one to specify a null value in an associative array (which is otherwise\r\n"
"-- discarded if you set the value with 'nil' in Lua. Simply set t = { first=json.null }\r\n"
"function null()\r\n"
"  return null -- so json.null() will also return null ;-)\r\n"
"end\r\n"
"-----------------------------------------------------------------------------\r\n"
"-- Internal, PRIVATE functions.\r\n"
"-- Following a Python-like convention, I have prefixed all these 'PRIVATE'\r\n"
"-- functions with an underscore.\r\n"
"-----------------------------------------------------------------------------\r\n"
"\r\n"
"--- Scans an array from JSON into a Lua object\r\n"
"-- startPos begins at the start of the array.\r\n"
"-- Returns the array and the next starting position\r\n"
"-- @param s The string being scanned.\r\n"
"-- @param startPos The starting position for the scan.\r\n"
"-- @return table, int The scanned array as a table, and the position of the next character to scan.\r\n"
"function decode_scanArray(s,startPos)\r\n"
"  local array = {}\t-- The return value\r\n"
"  local stringLen = string.len(s)\r\n"
"  base.assert(string.sub(s,startPos,startPos)=='[','decode_scanArray called but array does not start at position ' .. startPos .. ' in string:\\n'..s )\r\n"
"  startPos = startPos + 1\r\n"
"  -- Infinite loop for array elements\r\n"
"  repeat\r\n"
"    startPos = decode_scanWhitespace(s,startPos)\r\n"
"    base.assert(startPos<=stringLen,'JSON String ended unexpectedly scanning array.')\r\n"
"    local curChar = string.sub(s,startPos,startPos)\r\n"
"    if (curChar==']') then\r\n"
"      return array, startPos+1\r\n"
"    end\r\n"
"    if (curChar==',') then\r\n"
"      startPos = decode_scanWhitespace(s,startPos+1)\r\n"
"    end\r\n"
"    base.assert(startPos<=stringLen, 'JSON String ended unexpectedly scanning array.')\r\n"
"    object, startPos = decode(s,startPos)\r\n"
"    table.insert(array,object)\r\n"
"  until false\r\n"
"end\r\n"
"\r\n"
"--- Scans a comment and discards the comment.\r\n"
"-- Returns the position of the next character following the comment.\r\n"
"-- @param string s The JSON string to scan.\r\n"
"-- @param int startPos The starting position of the comment\r\n"
"function decode_scanComment(s, startPos)\r\n"
"  base.assert( string.sub(s,startPos,startPos+1)=='/*', \"decode_scanComment called but comment does not start at position \" .. startPos)\r\n"
"  local endPos = string.find(s,'*/',startPos+2)\r\n"
"  base.assert(endPos~=nil, \"Unterminated comment in string at \" .. startPos)\r\n"
"  return endPos+2  \r\n"
"end\r\n"
"\r\n"
"--- Scans for given constants: true, false or null\r\n"
"-- Returns the appropriate Lua type, and the position of the next character to read.\r\n"
"-- @param s The string being scanned.\r\n"
"-- @param startPos The position in the string at which to start scanning.\r\n"
"-- @return object, int The object (true, false or nil) and the position at which the next character should be \r\n"
"-- scanned.\r\n"
"function decode_scanConstant(s, startPos)\r\n"
"  local consts = { [\"true\"] = true, [\"false\"] = false, [\"null\"] = nil }\r\n"
"  local constNames = {\"true\",\"false\",\"null\"}\r\n"
"\r\n"
"  for i,k in base.pairs(constNames) do\r\n"
"    --print (\"[\" .. string.sub(s,startPos, startPos + string.len(k) -1) ..\"]\", k)\r\n"
"    if string.sub(s,startPos, startPos + string.len(k) -1 )==k then\r\n"
"      return consts[k], startPos + string.len(k)\r\n"
"    end\r\n"
"  end\r\n"
"  base.assert(nil, 'Failed to scan constant from string ' .. s .. ' at starting position ' .. startPos)\r\n"
"end\r\n"
"\r\n"
"--- Scans a number from the JSON encoded string.\r\n"
"-- (in fact, also is able to scan numeric +- eqns, which is not\r\n"
"-- in the JSON spec.)\r\n"
"-- Returns the number, and the position of the next character\r\n"
"-- after the number.\r\n"
"-- @param s The string being scanned.\r\n"
"-- @param startPos The position at which to start scanning.\r\n"
"-- @return number, int The extracted number and the position of the next character to scan.\r\n"
"function decode_scanNumber(s,startPos)\r\n"
"  local endPos = startPos+1\r\n"
"  local stringLen = string.len(s)\r\n"
"  local acceptableChars = \"+-0123456789.e\"\r\n"
"  while (string.find(acceptableChars, string.sub(s,endPos,endPos), 1, true)\r\n"
"\tand endPos<=stringLen\r\n"
"\t) do\r\n"
"    endPos = endPos + 1\r\n"
"  end\r\n"
"  local stringValue = 'return ' .. string.sub(s,startPos, endPos-1)\r\n"
"  local stringEval = base.loadstring(stringValue)\r\n"
"  base.assert(stringEval, 'Failed to scan number [ ' .. stringValue .. '] in JSON string at position ' .. startPos .. ' : ' .. endPos)\r\n"
"  return stringEval(), endPos\r\n"
"end\r\n"
"\r\n"
"--- Scans a JSON object into a Lua object.\r\n"
"-- startPos begins at the start of the object.\r\n"
"-- Returns the object and the next starting position.\r\n"
"-- @param s The string being scanned.\r\n"
"-- @param startPos The starting position of the scan.\r\n"
"-- @return table, int The scanned object as a table and the position of the next character to scan.\r\n"
"function decode_scanObject(s,startPos)\r\n"
"  local object = {}\r\n"
"  local stringLen = string.len(s)\r\n"
"  local key, value\r\n"
"  base.assert(string.sub(s,startPos,startPos)=='{','decode_scanObject called but object does not start at position ' .. startPos .. ' in string:\\n' .. s)\r\n"
"  startPos = startPos + 1\r\n"
"  repeat\r\n"
"    startPos = decode_scanWhitespace(s,startPos)\r\n"
"    base.assert(startPos<=stringLen, 'JSON string ended unexpectedly while scanning object.')\r\n"
"    local curChar = string.sub(s,startPos,startPos)\r\n"
"    if (curChar=='}') then\r\n"
"      return object,startPos+1\r\n"
"    end\r\n"
"    if (curChar==',') then\r\n"
"      startPos = decode_scanWhitespace(s,startPos+1)\r\n"
"    end\r\n"
"    base.assert(startPos<=stringLen, 'JSON string ended unexpectedly scanning object.')\r\n"
"    -- Scan the key\r\n"
"    key, startPos = decode(s,startPos)\r\n"
"    base.assert(startPos<=stringLen, 'JSON string ended unexpectedly searching for value of key ' .. key)\r\n"
"    startPos = decode_scanWhitespace(s,startPos)\r\n"
"    base.assert(startPos<=stringLen, 'JSON string ended unexpectedly searching for value of key ' .. key)\r\n"
"    base.assert(string.sub(s,startPos,startPos)==':','JSON object key-value assignment mal-formed at ' .. startPos)\r\n"
"    startPos = decode_scanWhitespace(s,startPos+1)\r\n"
"    base.assert(startPos<=stringLen, 'JSON string ended unexpectedly searching for value of key ' .. key)\r\n"
"    value, startPos = decode(s,startPos)\r\n"
"    object[key]=value\r\n"
"  until false\t-- infinite loop while key-value pairs are found\r\n"
"end\r\n"
"\r\n"
"-- START SoniEx2\r\n"
"-- Initialize some things used by decode_scanString\r\n"
"-- You know, for efficiency\r\n"
"local escapeSequences = {\r\n"
"  [\"\\\\t\"] = \"\\t\",\r\n"
"  [\"\\\\f\"] = \"\\f\",\r\n"
"  [\"\\\\r\"] = \"\\r\",\r\n"
"  [\"\\\\n\"] = \"\\n\",\r\n"
"  [\"\\\\b\"] = \"\\b\"\r\n"
"}\r\n"
"base.setmetatable(escapeSequences, {__index = function(t,k)\r\n"
"  -- skip \"\\\" aka strip escape\r\n"
"  return string.sub(k,2)\r\n"
"end})\r\n"
"-- END SoniEx2\r\n"
"\r\n"
"--- Scans a JSON string from the opening inverted comma or single quote to the\r\n"
"-- end of the string.\r\n"
"-- Returns the string extracted as a Lua string,\r\n"
"-- and the position of the next non-string character\r\n"
"-- (after the closing inverted comma or single quote).\r\n"
"-- @param s The string being scanned.\r\n"
"-- @param startPos The starting position of the scan.\r\n"
"-- @return string, int The extracted string as a Lua string, and the next character to parse.\r\n"
"function decode_scanString(s,startPos)\r\n"
"  base.assert(startPos, 'decode_scanString(..) called without start position')\r\n"
"  local startChar = string.sub(s,startPos,startPos)\r\n"
"  -- START SoniEx2\r\n"
"  -- PS: I don't think single quotes are valid JSON\r\n"
"  base.assert(startChar == [[\"]] or startChar == [[']],'decode_scanString called for a non-string')\r\n"
"  --base.assert(startPos, \"String decoding failed: missing closing \" .. startChar .. \" for string at position \" .. oldStart)\r\n"
"  local t = {}\r\n"
"  local i,j = startPos,startPos\r\n"
"  while string.find(s, startChar, j+1) ~= j+1 do\r\n"
"    local oldj = j\r\n"
"    i,j = string.find(s, \"\\\\.\", j+1)\r\n"
"    local x,y = string.find(s, startChar, oldj+1)\r\n"
"    if not i or x < i then\r\n"
"      base.print(s, startPos, string.sub(s,startPos,oldj))\r\n"
"      i,j = x,y-1\r\n"
"      if not x then base.print(s, startPos, string.sub(s,startPos,oldj)) end\r\n"
"    end\r\n"
"    table.insert(t, string.sub(s, oldj+1, i-1))\r\n"
"    if string.sub(s, i, j) == \"\\\\u\" then\r\n"
"      local a = string.sub(s,j+1,j+4)\r\n"
"      j = j + 4\r\n"
"      local n = base.tonumber(a, 16)\r\n"
"      base.assert(n, \"String decoding failed: bad Unicode escape \" .. a .. \" at position \" .. i .. \" : \" .. j)\r\n"
"      -- math.floor(x/2^y) == lazy right shift\r\n"
"      -- a % 2^b == bitwise_and(a, (2^b)-1)\r\n"
"      -- 64 = 2^6\r\n"
"      -- 4096 = 2^12 (or 2^6 * 2^6)\r\n"
"      local x\r\n"
"      if n < 0x80 then\r\n"
"        x = string.char(n % 0x80)\r\n"
"      elseif n < 0x800 then\r\n"
"        -- [110x xxxx] [10xx xxxx]\r\n"
"        x = string.char(0xC0 + (math.floor(n/64) % 0x20), 0x80 + (n % 0x40))\r\n"
"      else\r\n"
"        -- [1110 xxxx] [10xx xxxx] [10xx xxxx]\r\n"
"        x = string.char(0xE0 + (math.floor(n/4096) % 0x10), 0x80 + (math.floor(n/64) % 0x40), 0x80 + (n % 0x40))\r\n"
"      end\r\n"
"      table.insert(t, x)\r\n"
"    else\r\n"
"      table.insert(t, escapeSequences[string.sub(s, i, j)])\r\n"
"    end\r\n"
"  end\r\n"
"  table.insert(t,string.sub(j, j+1))\r\n"
"  base.assert(string.find(s, startChar, j+1), \"String decoding failed: missing closing \" .. startChar .. \" at position \" .. j .. \"(for string at position \" .. startPos .. \")\")\r\n"
"  return table.concat(t,\"\"), j+2\r\n"
"  -- END SoniEx2\r\n"
"end\r\n"
"\r\n"
"--- Scans a JSON string skipping all whitespace from the current start position.\r\n"
"-- Returns the position of the first non-whitespace character, or nil if the whole end of string is reached.\r\n"
"-- @param s The string being scanned\r\n"
"-- @param startPos The starting position where we should begin removing whitespace.\r\n"
"-- @return int The first position where non-whitespace was encountered, or string.len(s)+1 if the end of string\r\n"
"-- was reached.\r\n"
"function decode_scanWhitespace(s,startPos)\r\n"
"  local whitespace=\" \\n\\r\\t\"\r\n"
"  local stringLen = string.len(s)\r\n"
"  while ( string.find(whitespace, string.sub(s,startPos,startPos), 1, true)  and startPos <= stringLen) do\r\n"
"    startPos = startPos + 1\r\n"
"  end\r\n"
"  return startPos\r\n"
"end\r\n"
"\r\n"
"--- Encodes a string to be JSON-compatible.\r\n"
"-- This just involves back-quoting inverted commas, back-quotes and newlines, I think ;-)\r\n"
"-- @param s The string to return as a JSON encoded (i.e. backquoted string)\r\n"
"-- @return The string appropriately escaped.\r\n"
"\r\n"
"local escapeList = {\r\n"
"    ['\"']  = '\\\\\"',\r\n"
"    ['\\\\'] = '\\\\\\\\',\r\n"
"    ['/']  = '\\\\/', \r\n"
"    ['\\b'] = '\\\\b',\r\n"
"    ['\\f'] = '\\\\f',\r\n"
"    ['\\n'] = '\\\\n',\r\n"
"    ['\\r'] = '\\\\r',\r\n"
"    ['\\t'] = '\\\\t'\r\n"
"}\r\n"
"\r\n"
"function encodeString(s)\r\n"
" return s:gsub(\".\", function(c) return escapeList[c] end) -- SoniEx2: 5.0 compat\r\n"
"end\r\n"
"\r\n"
"-- Determines whether the given Lua type is an array or a table / dictionary.\r\n"
"-- We consider any table an array if it has indexes 1..n for its n items, and no\r\n"
"-- other data in the table.\r\n"
"-- I think this method is currently a little 'flaky', but can't think of a good way around it yet...\r\n"
"-- @param t The table to evaluate as an array\r\n"
"-- @return boolean, number True if the table can be represented as an array, false otherwise. If true,\r\n"
"-- the second returned value is the maximum\r\n"
"-- number of indexed elements in the array. \r\n"
"function isArray(t)\r\n"
"  -- Next we count all the elements, ensuring that any non-indexed elements are not-encodable \r\n"
"  -- (with the possible exception of 'n')\r\n"
"  local maxIndex = 0\r\n"
"  for k,v in base.pairs(t) do\r\n"
"    if (base.type(k)=='number' and math.floor(k)==k and 1<=k) then\t-- k,v is an indexed pair\r\n"
"      if (not isEncodable(v)) then return false end\t-- All array elements must be encodable\r\n"
"      maxIndex = math.max(maxIndex,k)\r\n"
"    else\r\n"
"      if (k=='n') then\r\n"
"        if v ~= table.getn(t) then return false end  -- False if n does not hold the number of elements\r\n"
"      else -- Else of (k=='n')\r\n"
"        if isEncodable(v) then return false end\r\n"
"      end  -- End of (k~='n')\r\n"
"    end -- End of k,v not an indexed pair\r\n"
"  end  -- End of loop across all pairs\r\n"
"  return true, maxIndex\r\n"
"end\r\n"
"\r\n"
"--- Determines whether the given Lua object / table / variable can be JSON encoded. The only\r\n"
"-- types that are JSON encodable are: string, boolean, number, nil, table and json.null.\r\n"
"-- In this implementation, all other types are ignored.\r\n"
"-- @param o The object to examine.\r\n"
"-- @return boolean True if the object should be JSON encoded, false if it should be ignored.\r\n"
"function isEncodable(o)\r\n"
"  local t = base.type(o)\r\n"
"  return (t=='string' or t=='boolean' or t=='number' or t=='nil' or t=='table') or (t=='function' and o==null) \r\n"
"end\r\n"
"\r\n";

